import './App.css';
import Nav from './components/header/nav.js';
import Summary from './components/summary/summary';
import About from './components/about/about';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Nav/>
      </header>
      <div className='body'>
        <Summary/>
      </div>
    </div>
  );
}

export default App;
